function Product() {
  // https://fakestoreapi.com/products
  const [prod, setprod] = useState([]);
  // console.log(prod);
  useEffect(() => {
    fetchApiData();
  }, []);

  const fetchApiData = () => {
    fetch("http://54.82.19.87:9000/store/products", {
      mode: "no-cors",
      method: "get",
      headers: {
        "Content-Type": "application/json",
      },
