      .then((data) => {
        console.log(data);
        setprod(data);
      });
    // const jsondata = await response.json();
  };
  fetchApiData();

  return (
    <div className="product-page">
      <Header name="Priya" />
      <div className="product-c">
        {/* {console.log(prod)} */}
        {/* {fake.map((values) => {
          return (
            <Link to="/product-name">
              <Photobook img={values.image} desc={values.title} />
            </Link>
          );
        })} */}
      </div>
      {/* {
        data.map(x=>(
          <Link to="/product-name" ><Photobook img={photobookbg} /></Link>
        ))
      } */}
      <BottomNavbar />
    </div>
  );
}

export default Product;
